export const setLike = (like) => {
  return {
    type: 'LIKE_PLUS',
    payload: like,
  };
};

export const setCategory = (catIndex) => ({
  type: 'SET_POST1',
  payload: catIndex,
});

export const subscribe = (follow) => {
  return {
    type: 'FOLLOW_PLUS',
    payload: follow,
  };
};
